import React from 'react';
import '../css/styles.css'; 

const IdentityServer = () => {
    return (
        <div className="centered">
            <a className="logo" href="/">
                <img src="/images/wso2-logo.webp" alt="WSO2 Logo" width="100" />
            </a> 
            <h2>WSO2 Identity Server Authentication Demo</h2>
            <a className="mockbutton" href="usernamepassword">Username/Password</a>
            <a className="mockbutton" href="social">Social</a>
            <a className="mockbutton" href="otp-email">OTP-Email</a>
            <a className="mockbutton" href="otp-sms">OTP-SMS</a>
            <a className="mockbutton" href="fido">FIDO</a>
        </div>
    );
};

export default IdentityServer;
